import Jumbotron from 'react-bootstrap/Jumbotron';
import { Container, Row, Col } from 'react-bootstrap';

function Hero() {
    return (
        <Jumbotron>
             <Container>
                 <Row>
                     <Col>
                        <h2> Amar Pad</h2>
                     </Col>
                 </Row>
             </Container>
        </Jumbotron>
    );
}

export default Hero;
